tipoRouter.get('/:id', getTipo);
tipoRouter.get('/', getTipos);
tipoRouter.post('/', createTipo);
tipoRouter.put('/:id', updateTipo);
tipoRouter.delete('/:id', deleteTipo);

export default tipoRouter;

